import {ExtractStep} from "../utils/constants";
import {useNavigate} from "react-router-dom";
import React, {useEffect, useState} from "react";
import ExtractDataHeader from "../components/ExtractDataHeader";
import {ExtractStepper} from "../components/ExtractStepper";
import {Button, Icon} from "@trussworks/react-uswds";
import {Divider} from "../components/Divider";
import documentImage from "./SyphForm.png"; //Please enter your file of choice here
import aiIconUrl from "../assets/ai_icon.svg";
import {SortableTable} from "../components/SortableTable/SortableTable.tsx";
import {EditableText} from "../components/EditableText/EditableText.tsx";
import ErrorIcon from '../assets/error_icon.svg';

import "./ReviewTemplate.scss";


interface Row {
  isEdited: boolean;
  index: number;
  isError: boolean;
  name: string;
}

interface Result {
    text: string;
    confidence: number;
    edited?: boolean;
}

interface SubmissionData {
    template_name: string;
    file_image: string;
    results: {
        [key: string]: Result;
    };
}

const ReviewTemplate: React.FC = () => {
    const navigate = useNavigate();
    const [index, setIndex] = useState<number>(0);
    const [submissionData, setSubmissionData] = useState<SubmissionData | null>(
        null
    );

    const [images, setImages] = useState<string[]>([]);
    const [templates, setTemplates] = useState<Template[]>([]);
    const [selectedField, setSelectedField] = useState<string | null>(null);
    const [editedValues, setEditedValues] = useState<Map<string, string>>(new Map());

    const fakeData = {
      template_name: "Test",
      template_image: "data:image/png;base64,",
      file_name: "image name",
      file_image: "data:image/png;base64,",
      results: {
          Name: {
              text: "TESTPATIENT,13",
              confidence: 97,
          },
          Patient_ID: {
              text: "12090546",
              confidence: 98,
          },
          DrawLocation: {
              text: "BH_1Diamondd_LAB",
              confidence: 56,
          },
      },
  };


  const handleImageChange = (index: number) => {
      setIndex(index);
  }

  const onDownload = () => {
    try {
      if (submissionData) {
        // Prepare CSV data with column names
        const csvData = [
          ['label', 'value'], // Column names
          ...Object.entries(submissionData.results).map(([k, v]) => [k, v.text]) // Data rows
        ]
          .map(row => row.join(',')) // Join each row with commas
          .join('\n'); // Join rows with newlines
    
        const blob = new Blob([csvData], { type: 'text/csv' });
        const url = URL.createObjectURL(blob);
    
        const a = document.createElement('a');
        a.href = url;
        a.download = 'submission_data.csv'; // Filename
        document.body.appendChild(a); // Append to body
        a.click(); // Trigger download
        document.body.removeChild(a); // Clean up
        URL.revokeObjectURL(url); // Revoke URL
      }
    } catch (error) {
      console.error(error);
    }
  
  };
  
    
  useEffect(() => {
    const data = localStorage.getItem("submission");
    if (data) {
      setSubmissionData(JSON.parse(data));
    } else {
      // use fakedata if no data
      setSubmissionData(fakeData);
    }
  }, []);

  useEffect(() => {
    const data = localStorage.getItem("images");
    if (data) {
        setImages(JSON.parse(data));
    } else {
        // use fakedata if no data
        setImages([documentImage]);
    }
  }, []);

    const handleBack = () => {
        navigate("/extract/upload");
    };

    const handleSubmit = () => {
        navigate("/extract/submit");
    };

    const handleClose = () => {
        navigate("/");
    };

    useEffect(() => {
        const data = localStorage.getItem("templates");
        if (data) {
            setTemplates(JSON.parse(data));
        }
    }, []);


    const template = templates.filter(t => t.name === submissionData?.template_name)?.[0]
    const fieldShapes = template?.pages[index]?.fieldNames.reduce((acc, curr, idx) => {
        acc[curr.label] = template.pages[index].shapes[idx].points
        return acc
    }, {}) || {};


    const maskShape = fieldShapes[selectedField]?.map(([x, y]) => `${x},${y}`)?.join(" ");


    //fallback if no valid template is available can edit if needed
    if (!submissionData) {
        return <div>No submission Data</div>;
    }
    const {file_image, results} = submissionData;
    const confidenceVal = 75;

    const resultsTable = Object.entries(results).map(([k, v], idx) => {
        const overrideValue = editedValues[k]
        return {
            index: idx,
            name: k,
            value: overrideValue || v.text,
            confidence: overrideValue ? 100 : v.confidence,
            isError: overrideValue ? false : v.confidence <= confidenceVal,
            isEdited: !!overrideValue
        }
    });

    const calculateOverallConfidence = () => {
        if (!submissionData) return 0;
        const results = resultsTable;
        const totalConfidence = results.reduce((sum, result) => {
            return sum + result.confidence;
        }, 0);
        return (totalConfidence / results.length).toFixed(2);
    };

    const errorCount = resultsTable.filter(
        (r) => r.isError
    ).length;
    const hasErrors = errorCount > 0;
    const overallConfidence = calculateOverallConfidence();

    const labelConfidenceFormatter = (d, _idx, row) => {
        return row.isEdited ? "Edited" : redTextOnErrorFormatter(`${d.toFixed(0)}%`, row.index, row)
    }

    const redTextOnErrorFormatter = (d: string | number, _idx: number, row: Row) => {
      return row.isError ? <span className="error-text">{d}</span> : d;
    }

    const editCellFormatter = (d: unknown | string, _idx: number, row: Row) => {
      return <EditableText dataTestId={`${row.isError ? 'edit-fix-error' : null}`} text={d as string}
        onEdit={() => setSelectedField(row.name)}
        onCancel={() => setSelectedField(null)}
       onSave={(value) => {
        setEditedValues({...editedValues, [row.name]: value});
        setSubmissionData(prevData => {
          if (prevData) {
            return {
              ...prevData,
              results: {
                ...prevData.results,
                [row.name]: {
                  ...prevData.results[row.name],
                  text: value,
                  edited: true
                }
              }
            };
          }
          return prevData;
        });
      }} textFormatter={(s) => row.isError ?  <span className="error-text"><img className="error-tex margin-right-05" src={ErrorIcon} alt="error-icon"></img>{s}</span> : s}/>
    }
  return (
      <div className="display-flex flex-column flex-justify-start width-full height-full padding-1 padding-top-2">
        <ExtractDataHeader
          hasSubmit={false}
          onSubmit={handleSubmit}
          onExit={handleClose}
          onBack={handleBack}
          isUploadComplete={!hasErrors}
        />
        <Divider margin="0px" />
        <div className="display-flex flex-justify-center padding-top-4">
          <ExtractStepper currentStep={ExtractStep.Review} />
        </div>

        <div className="display-flex flex-justify-between padding-top-4">
          <div className="width-50">
            <div className="display-flex flex-column review-template-header-container">
                <h2>Extracted Data</h2>
                <span className="font-sans-md font-weight-semibold display-flex flex-align-center">
                  <img src={aiIconUrl} alt="ai-icon" aria-hidden="true"></img>
                  <b> Overall confidence score (CS): </b>
                  <span
                    className={`text-black margin-left-05 ${
                      Number(overallConfidence) < Number(confidenceVal)
                        ? "text-error"
                        : "text-success-confidence"
                    }`}
                  >
                    {overallConfidence}%
                  </span>
                  <div className="custom-tooltip-container display-flex flex-align-center">
                    <Icon.Help aria-hidden={true} />
                    <span className="custom-tooltip-text">
                      Overall Confidence Score is the average of all Individual
                      Confidence Scores.
                    </span>
                  </div>
                </span>
                <p className="font-sans">
                Review and edit errors before you submit.
                </p>
                <div className="display-flex flex-align-center error-text">
                  {hasErrors && (
                    <>
                      <span className="font-sans-sm margin-right-1">
                        Errors: {errorCount}
                      </span>
                      <img src={ErrorIcon} alt="Error Icon" aria-hidden={true} />
                    </>
                  )}
                </div>
            </div>
            
            <div className="table-group-container display-flex flex-column">
            <div className="display-flex flex-align-center width-full review-template-header-outer">
                  <div className="width-full display-flex flex-justify review-template-header flex-align-center">
                    <h3>Data Validation</h3>
                    <Button className="csv display-flex flex-align-center" disabled={errorCount > 0} type="button" onClick={onDownload}><Icon.FileDownload className="csv-icon" />Download CSV</Button>
                  </div>
              </div>
              <div className="table-container">
                <SortableTable
                    columns={["name", "value", "confidence"]}
                    data={resultsTable}
                    sortableBy={["name", "confidence", "value"]}
                    defaultSort={"confidence"}
                    columnNames={{name: "Label", value: "Value", isError: " ", confidence: "Label CS"}}
                    formatters={{ confidence: labelConfidenceFormatter, value: editCellFormatter}}
                  />
                </div>
            </div>

            <div className="display-flex flex-align-center review-button-container">
                  <Button
                    className="extract-button-reset"
                    onClick={() => navigate("/extract/upload")}
                    type="reset"
                    outline
                  >
                    Cancel
                  </Button>
                  <Button
                    className="extract-button-submit"
                    onClick={() => navigate("/")}
                    type="submit"
                    disabled={hasErrors}
                  >
                    Done
                  </Button>
                </div>
          </div>
          <div className="image-container">
                      <div
                          className="width-full height-full bg-white border-gray-5 border-1px"
                      >
                          <div>
                              {images.map((_, index) => (
                                  <Button key={index} onClick={() => handleImageChange(index)} type='button'>
                                      Image {index + 1}
                                  </Button>
                              ))}
                          </div>
                          {
                              images.map((image, innerIndex) => (
                                  <svg viewBox="0 0 612 720" key={innerIndex} width='100%' height='100%'>
                                      <image result="photo"
                                            href={image}
                                            preserveAspectRatio="xMidYMid slice"
                                      ></image>
                                      <polygon
                                          points={maskShape}
                                          stroke="blue" fill="none"/>
                                  </svg>

                              ))
                          }
                      </div>
                    </div>
              </div>
      </div>
    );
};

export default ReviewTemplate;